import { Component } from 'react'


const styles = {
	ticket: {
		backgroundColor: 'grey',
		border: 'solid 1px #eee',
		marginTop: 30,
		boxShadow: '1px 5px 5px rgb(0,0,0,0.3)',
		borderRadius: '5px',
		width: '600px',
		height: '70px',
		cursor: 'pointer'
	}
}
class Ticket extends Component{
	render(){
		return(
			<div style={styles.ticket}>
				<h1>ticket</h1>
			</div>
		)
	}
}

export default Ticket
